import React,{ Component } from "react";
import { Link } from "react-router-dom";

export default class AddMovie extends Component {
  constructor() {
    super();

    this.state = {
      filmes: []
    }
  }


  render() {
    return (
      <>
        <input type="text" />
        <button type="button">Adicionar filme</button>
        <Link to="/filmes" >Filmes</Link>
      </>
    );
  }
}
